import React, { useEffect } from 'react';
import 'swiper/css';
import 'swiper/css/effect-cube';
import 'swiper/css/pagination';
import { EffectCube, Pagination } from 'swiper/modules';
import { Swiper, SwiperSlide } from 'swiper/react';
import Footer from "../components/Footer.js";
import CplusplusLogo from "../images/C++Logo.png";
import javaLogo from "../images/javaLogo.png";
import javscriptLogo from "../images/javascriptLogo.png";
import pythonLogo from "../images/pythonLogo.png";
// Import Swiper React components
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';

// import './styles.css';

// import required modules
import { Navigation, Parallax } from 'swiper/modules';
import './Home.css';
function Home(props) {
useEffect(() => {
props.setProgress(50);
setTimeout(() => {
    props.setProgress(100);
}, 500);
}, []);
return (
<>
    <section id="section1">
    {/* <CarouselComponent /> */}
<Swiper
    style={{
        '--swiper-navigation-color': '#fff',
        '--swiper-pagination-color': '#fff',
    }}
    speed={600}
    parallax={true}
    pagination={{
        clickable: true,
    }}
    navigation={true}
    modules={[Parallax, Pagination, Navigation]}
    className="mySwiper"
    >
    <div
        slot="container-start"
        className="parallax-bg"
        style={{
        'background-image':
            'url(https://swiperjs.com/demos/images/nature-1.jpg)',
        }}
        data-swiper-parallax="-23%"
    ></div>
    <SwiperSlide>
        <div className="title" data-swiper-parallax="-300">
        Slide 1
        </div>
        <div className="subtitle" data-swiper-parallax="-200">
        Subtitle
        </div>
        <div className="text" data-swiper-parallax="-100">
        <p>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aliquam
            dictum mattis velit, sit amet faucibus felis iaculis nec. Nulla
            laoreet justo vitae porttitor porttitor. Suspendisse in sem justo.
            Integer laoreet magna nec elit suscipit, ac laoreet nibh euismod.
            Aliquam hendrerit lorem at elit facilisis rutrum. Ut at
            ullamcorper velit. Nulla ligula nisi, imperdiet ut lacinia nec,
            tincidunt ut libero. Aenean feugiat non eros quis feugiat.
        </p>
        </div>
    </SwiperSlide>
    <SwiperSlide>
        <div className="title" data-swiper-parallax="-300">
        Slide 2
        </div>
        <div className="subtitle" data-swiper-parallax="-200">
        Subtitle
        </div>
        <div className="text" data-swiper-parallax="-100">
        <p>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aliquam
            dictum mattis velit, sit amet faucibus felis iaculis nec. Nulla
            laoreet justo vitae porttitor porttitor. Suspendisse in sem justo.
            Integer laoreet magna nec elit suscipit, ac laoreet nibh euismod.
            Aliquam hendrerit lorem at elit facilisis rutrum. Ut at
            ullamcorper velit. Nulla ligula nisi, imperdiet ut lacinia nec,
            tincidunt ut libero. Aenean feugiat non eros quis feugiat.
        </p>
        </div>
    </SwiperSlide>
    <SwiperSlide>
        <div className="title" data-swiper-parallax="-300">
        Slide 3
        </div>
        <div className="subtitle" data-swiper-parallax="-200">
        Subtitle
        </div>
        <div className="text" data-swiper-parallax="-100">
        <p>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aliquam
            dictum mattis velit, sit amet faucibus felis iaculis nec. Nulla
            laoreet justo vitae porttitor porttitor. Suspendisse in sem justo.
            Integer laoreet magna nec elit suscipit, ac laoreet nibh euismod.
            Aliquam hendrerit lorem at elit facilisis rutrum. Ut at
            ullamcorper velit. Nulla ligula nisi, imperdiet ut lacinia nec,
            tincidunt ut libero. Aenean feugiat non eros quis feugiat.
        </p>
        </div>
    </SwiperSlide>
    </Swiper>
    </section>

    <section className="my-3" id="section2">
    <h1 className="text-center" style={{color:"whitesmoke"}}>Some Content</h1>
    </section>

    <section className="my-3" id="section3">
    <h2 className="text-center" style={{color:"whitesmoke"}}>Available for</h2>
    <div className="my-3 text-center">
    <Swiper
        effect={'cube'}
        grabCursor={true}
        cubeEffect={{
        shadow: true,
        slideShadows: true,
        shadowOffset: 20,
        shadowScale: 0.94,
        }}
        pagination={false}
        modules={[EffectCube, Pagination]}
        autoplay={{
            delay: 1000, // Set the delay in milliseconds (adjust as needed)
            disableOnInteraction: false, // Allow manual interaction to not stop autoplay
        }}
          loop={true} // Enable loop if you want continuous rotation
        className="mySwiper"
    >
        <SwiperSlide>
        <img style={{backgroundColor:"black"}} src={pythonLogo} />
        </SwiperSlide>

        <SwiperSlide>
            <img style={{backgroundColor:"black"}} src={javscriptLogo}/>
        </SwiperSlide>

        <SwiperSlide>
            <img style={{backgroundColor:"black"}} src={CplusplusLogo} />
        </SwiperSlide>

        <SwiperSlide>
            <img style={{backgroundColor:"black"}} src={javaLogo} />
        </SwiperSlide>
    </Swiper>
    </div>
    </section>

    <section className="my-3" id="section4">
    <h2 style={{color:"whitesmoke"}} className="text-center">About us</h2>
    <div className="my-3 container">
        <div>
        <h3>Our Mission</h3>
        <p>At codeVISTA, our mission is to create a dynamic online space where coders of all levels and backgrounds can come together to learn, create, and collaborate. We aim to provide a seamless and powerful code compilation experience that transcends barriers, making coding accessible to everyone. Through our vibrant community, we aspire to foster knowledge sharing, mentorship, and a sense of belonging among coders worldwide. Our commitment is to empower individuals to turn their code into impactful solutions, driving innovation and excellence in the ever-evolving world of technology.</p>
        </div>
        <div>
        <h3>Our Vision</h3>
        <p>.......</p>
        </div>
    </div>
    </section>

    <section id="section5">
    <div className="container">
        <h2 className="text-center">Our Team</h2>
        <p>image and about our team</p>
    </div>
    </section>

    <section id="section5">
    <Footer></Footer>
    </section>

</>
);
}

export default Home;
